CREATE TABLE `fa_auction` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'id',
  `title` varchar(255) DEFAULT NULL COMMENT '标题',
  `image` text COMMENT '图片',
  `address` varchar(255) DEFAULT NULL COMMENT '发起人',
  `amount` int(11) DEFAULT '0' COMMENT '价值',
  `deadline` int(11) DEFAULT NULL COMMENT '截至时间',
  `bid_address` varchar(255) DEFAULT NULL COMMENT '最终竞拍人',
  `sn` varchar(255) DEFAULT NULL COMMENT '编号',
  `txid` varchar(255) DEFAULT NULL,
  `status` varchar(255) DEFAULT 'pending' COMMENT '状态',
  `createtime` int(11) DEFAULT NULL COMMENT '创建时间',
  `updatetime` int(11) DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=69 DEFAULT CHARSET=utf8mb4;

